('UPFC515', 'Fita Corretiva 5 mm x 15 m - Fita em Pet - Yes', 'Fita Corretiva 5mm de largura x 15m de comprimento Yes. Fita produzida em material 100% reciclável PET. Com correção a seco, aplicação firme e cobertura uniforme, permite escrita instantânea após a aplicação. Invísivel após fotocópia. Formato anatômico que permite fácil \r\nmanuseio, com correções limpas e precisas. O corpo transparente permite ver a quantidade que ainda há de fita. Atóxico e acid free e não precisa de refil. Possui embalagem blistada individualmente. Embalagem display com 12 unidades sortidas.', 'LE', '0265', '1', '0', '2013-05-17', '0515', 73, 0, 1, 1),
('UPG09B', 'Grafite 0.9 mm - B  - Tubo com 12 minas', 'Minas de grafite para lapiseiras 0.9 mm graduaçao B. Possui tampa "Flip Top", que evita quebras e perdas, suportando uma maior pressão na hora da escrita, sem perder a suavidade e tonalidade, maior resistência e traço forte. Perfeito para desenhos técnicos de alta precisão.  Embalagem com 12 unidades. Cada tubo possui 12 minas.', 'LE', '0018', '0', '0', '2013-05-17', '0060', 73, 0, 1, 1),
('UPLA9041', 'Caixa com Lâminas para Estiletes 9 mm - SDI', 'Lâminas para estilete 9 mm. Caixa com 10 unidades. Medidas: 80x9mm', 'EO', '0262', '0', '0', '2013-05-17', '0198', 73, 0, 1, 1),
('UPMT0901T', 'Marca Texto 3 em 1 - Bismark - Pote c/ 24 unidades', 'Marca texto 3 em 1 com 3 pontas coloridas reposicionáveis da linha Bismark. Pote com 24 unidades', 'LE', '0093', '0', '0', '2013-05-17', '0481', 73, 0, 1, 1),
('UPPK2401', 'Display Caneta Hidrográfica Ponta 0.4 mm-240 unid', 'No escritório, na escola e no lar! As caneta Liquid Fineliner sao acid free, possuem estojos exclusivos no formato tubo, ponta de 0.4 mm com proteçao metálica, tampa antissufocante, nao seca se ficar destampado por alguns dias, tinta à base de água com secagem rápida. Formato triangular com display com 12 cores e 240 unidades', 'LE', '0031', '0', '0', '2013-05-17', '0463', 73, 0, 1, 1),
('UPPM103', 'Lapiseira Técnica 0.3 mm - Precision Trend', 'Lapiseira técnica 0,3 mm, possui formato anatômico e seu mecanismo é em metal. Embalagem com 12 unidades. Tamanho: 150 mm', 'LE', '0032', '0', '0', '2013-05-17', '0051', 73, 0, 1, 1),
('UPPM105', 'Lapiseira Técnica 0.5 mm - Precision Trend', 'Formato anatômico. Mecanismo em metal. Medida: 150 mm. Ideal para desenhos técnicos. Confira nossos grafites 2B,3B e HB.', 'LE', '0032', '0', '0', '2013-05-17', '0054', 73, 0, 1, 1),
('UPPM107', 'Lapiseira Técnica 0.7 mm - Precision Trend', 'Lapiseira técnica 0,7 mm, possui formato anatômico, seu mecanismo é em metal e possui apoio para os dedos. Embalagem com 12 unidades. Tamanho: 150 mm', 'LE', '0032', '0', '0', '2013-05-17', '0056', 73, 0, 1, 1),
('UPPTWT', 'Cola Líquida 2 Pontas  - Aqua Pit - Tombow', 'Cola etiqueta Aqua Pit Tombow, com duas pontas: uma grossa para grandes áreas e outra fina para detalhes. Adere metal, plástico, vidro e outros materiais no papel.  Nao entope e nem vaza. Atóxica, lavável e inodora.. Dimensões: 34x134x28mm Peso 1.200,0 g', 'EO', '0048', '0', '0', '2013-05-17', '0116', 73, 0, 1, 1),
('UPRU1501', 'Régua Plástica com Borda Metálica - 15cm', 'Régua com borda metálica. Embalagem em tubo PVC transparente com 18 réguas cristal e 6 fume. Medidas: 15cm', 'EO', '0046', '0', '0', '2013-05-17', '0336', 73, 0, 1, 1),
